import {ColorModeScript} from '@chakra-ui/react';
import theme from './theme';

function App() {
  return (
    <ChakraProvider>
      <Flex w="100%" h="100svh"  justify="center" align="center">
        <Flex  maxW="480px" w="100%" maxH="896px" h="100%">
        <ColorModeScript initialColorMode={theme.config.initialColorMode} />      

          <NavBar/>
        </Flex>
      </Flex>
    </ChakraProvider>
  );
}

export default App;
